Jerusalema (2008)  

Zuid-Afrika
Actie / Misdaad
120 minuten

geregisseerd door Ralph Ziman
met Rapulana Seiphemo, Ronnie Nyakale en Shelly Meskin

Lucky Kunene (Rapulana Seiphemo) is een jongeman uit de sloppenwijken van Soweto. De apartheid is net afgeschaft en Kunene ziet een nieuwe wereld opengaan. Hij probeert op het rechte pad te blijven, maar dat blijkt niet zo eenvoudig...

